import React from 'react';
import styled from 'styled-components';
import {connect} from 'react-redux';
import {getCoordinatorStories} from '../actions'
import Popup from 'reactjs-popup';

// username: 'nicholl',
// password: 'rHUnhgFbkGRLNVyX',
// email: 'Nicholl.OblitasCosta@p3foundation.org',
// role: 'Coordinator',
// country: 'Kiribati',
// organization_title: 'CEO'

import ListviewComponent from '../components/ListviewComponent';

const ListContainer = styled.div`
  display: flex;
  flex-direction: column;
  align-items: center;
`

class CoordinatorHome extends React.Component {
  constructor(props){
    super(props);
  }

  componentDidMount(){
    this.props.getCoordinatorStories('nicholl');
  }

  render(){
    return (
      <div>
        <ListContainer>
          {this.props.getCoordinatorStories.map(story => <ListviewComponent story={story}/>)}
        </ListContainer>
        <button>New Story</button>

      </div>
    );
  }
}

const mstp = (state) => {
  return {
    coordinatorStories: state.coordinatorStories
  };
}

export default connect(mstp, {getCoordinatorStories: getCoordinatorStories})(CoordinatorHome)
